import React, { useState } from 'react';


const Index = () => {
    // 声明一个新的叫做 “count” 的 state 变量
    const [count, setCount] = useState(0);
    return (
        <div>
            <p>You clicked {count} times</p>
            <button onClick={() => setCount(count + 1)}>
                Click me
            </button>
        </div>
    );
};

export default Index;
